import React from "react"
import { connect } from 'react-redux'
import Card from 'react-bootstrap/Card'


const TransactionPanel = () => {

  const showTransactions = (transactions) => { 
    return (
      <Card>
        <Card.body>
          <Card.title> Transaction Name </Card.title>
        </Card.body>
      </Card>
    )
  }
  // ONE TRANSACTION
  // 0:
